import React from "react";
import { ReactSVG } from "react-svg";
import perplexityIcon from "../images/perplexity-icon.svg";
import NewThread from "../New_Thread/NewThread";
import Discover from "../Discover/Discover";
import Library from "../Library/Library";
import Login from "../Login/Login";
import Signup from "../Signup/Signup";

function Navbar() {
	return (
		<nav>
			<div className='first-part'>
				<div className='nav-item icon'>
					<ReactSVG src={perplexityIcon} title='Title' />
				</div>
				<div className='nav-item'>
					<NewThread />
				</div>
				<div className='nav-item'>
					Home
				</div>
				<div className='nav-item'>
					<Discover />
				</div>
				<div className='nav-item'>
					<Library />
				</div>
				<div className='nav-item'>
					<Login />
				</div>
				<div className='nav-item'>
					<Signup/>
				</div>
			</div>
			<div className='second-part'>
				<div>TryPro</div>
				<div>
					Upgrade to Claude-2 or GPT-4, boost your Copilot uses, and upload more
					files.
				</div>
			</div>
		</nav>
	);
}

export default Navbar;
